import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

state = {
    unidentified: []
}

style = {
    overflow: 'scroll',
    height: '350px'
}


render(){

    setInterval(()=>{
        let newList = this.state.unidentified.map((e)=>{
            return e
        })
        newList.push(<FeedItem>ALECLAWLOR</FeedItem>)
        this.setState(newList)
    }, 3000)

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        {this.state.unidentified}
    </div>)}
}


export default unregisteredFeed
